console.log('Hammer');
setTimeout(function() {
	var myElement = document.getElementById('hammer-gesture');

	var mc = new Hammer(myElement);

	mc.on("panleft panright tap press", function(ev) {
		console.log('gesture detected.')
		myElement.textContent = ev.type +" gesture detected.";
	});
}, 100);
